  const modelRef = React.useRef();

  return (
      <model-viewer
          // className="model-viewer"
          src="./M08.glb"
          alt="A rock"
          exposure="0.008"
          camera-controls
          ar
          ar-modes="webxr"
          ref={(ref) => {
            modelRef.current = ref;
          }}
      >
      </model-viewer>
  );
}

export default App;
